import { productsState } from "../../store/products/state";
import "./Product.css"



function Product({products}){
    console.log(products);
    return(
        <div className="div_main">
                            <div className="div_img">
                                <img className="image-grid-col-2" src={products.img[0]}/>
                            </div>
                            <div className="div_txt">
                                <h1>{products.name}</h1>
                                <div><h3>{products.category}</h3></div>
                                <button onClick={()=>products.filter((el)=>el.id!=products.id)}>Delete Product</button>
                            </div>
                        </div>
    )
}

export default Product;
